import Main from "./Main.js";
import './App.css'

export default class App extends PureComponent {
  constructor(props)
  {
	  super(props);
	  this.state = {
		  login: ''
	  }
  }
  render() {
	return (
	  <div className='App'>
	    <div className='navMenu'>
	      <Menu />
		</div>
		<Main />
	  </div>
	);
  }
}
